import React from "react";
import {Link} from "react-router-dom";
import png from './upside ground coffee bag.png';

function home() {
    return (
<div className="home">
      <header className="home-header">
        <p>
          <img src= "upside ground logo.jpg" alt ="logo" className ="logo"  />
        </p>
        <link to= 'login' 
        >
          login
        </link>
     
        <a
    
          className="signup"
          href= "log in"
          target="_blank"
          rel="noopener noreferrer"
        >
         sign up
        </a>
      </header>
      <p>
          <img src= {png} alt ="bag1" className ="bag1"  />
        </p>   

        
        </div>
 );
}

export default home;
